import axios from 'axios';

const apps = async () => {
  try {
    const response = await axios.get('http://localhost:3001/usuarios');
    const apps = response.data.map(app => ({
      ...app,
      imagenUrl: URL.createObjectURL(app.imagen)
    }));
    return apps;
  } catch (error) {
    console.error('Error fetching apps:', error);
    return [];
  }
};

export default apps;
